import React from 'react';

import Tile from '../components/Tile/Tile'

import styles from './AppointmentPage.module.css'


let last_props = [];

export default class AppointmentPage extends React.Component{
	render() {
		console.log(last_props, this.props.departments)
		if ((!this.props.departments) || (last_props.length!==this.props.departments.length)) {
			last_props = this.props.departments;
			this.props.handleAppointment();
			return null;
		} else if (this.props.departments.length) {
			return <h2>{'У вас пока нет записей!'}</h2>;
		}
		const doctors = [...new Set(this.props.departments.map(x => x.available_resource_id))];
		return (
			<div className={styles.page}>
				<ul className={styles.list}>
					{doctors
						.map(doctor => 
							<Tile
								key={doctor}
								handleDelete={() => this.props.handleDeleteAllAppointment(doctor)}
								handleDeleteItem={this.props.handleDeleteAppointment}
								appointments={this.props.departments.filter(x => x.available_resource_id === doctor)}
							/>)
					}
				</ul>
			</div>
		);
	};
};
